export const getStaticProps: GetStaticProps = async () => {
  const entriesPath = path.join(
    process.cwd(),
    "data",
    "timeline",
    "entries.json"
  );
  const fileContents = await fs.readFile(entriesPath, "utf8");
  const timeline_entries = JSON.parse(fileContents);

  const chunks = 2;

  const tools = [];
  for (let i = 0; i < timeline_entries.tools.length; i++) {
    tools.push(timeline_entries.tools.splice(0, chunks));
  }

  if (timeline_entries.tools.length > 0) {
    tools.push([
      timeline_entries.tools[timeline_entries.tools.length - chunks + 1],
    ]);
  }

  return {
    props: {
      favorite_tools: tools,
    },
  };
};
